See original PR: #6141. Then this was changed in PR #10828, see discussion that starts [here](https://github.com/DefinitelyTyped/DefinitelyTyped/pull/10828#issuecomment-249673157).

Before:

```TypeScript
interface FooBar {
  // ...
}
fetch(url)
  .then(response => <Promise<FooBar>> response.json()) // Cast needed
  .then(fooBar => console.log(fooBar));
```

Now:
```TypeScript
interface FooBar {
  // ...
}
fetch(url)
  .then(response => response.json<FooBar>()) // No cast needed
  .then(fooBar => console.log(fooBar));
```

Introducing `json<T>()` still allow the casting syntax, nothing changes here (see tests added in this PR).

