This PR will allow the following:

```ts

import * as pino from 'pino';

export function getLogger (name: string):pino.Logger {
  return pino({
    name: name,
    level: 'trace'
  });
};
```

Previously there was no way to infer typings for the returned value in the above example. Technically pino behaves as a CommonJS module, but it does export extra functions and properties [link](https://github.com/pinojs/pino/blob/master/pino.js#L453)

I was unsure about increasing the header number, but have changed it to match the version of pino I am running.
